description:
Special Weapons for Military &amp; Police Magazine

First published in 2001, the magazine gives readers the unmatched insider look at today's new high-tech weapons, gear, and tactics used by the pros who face the ultimate dangers. 

Each bimonthly issue covers weapon reviews, as well as articles that highlight their real-world application. Some of Special Weapons for Military &amp; Police magazine's regular sections include: &quot;Op Tech,&quot; &quot;Sniper Pro,&quot; &quot;Battle Ready,&quot; &quot;Combat Optics,&quot; &quot;Guns of the Elite,&quot; &quot;Advanced Training,&quot; &quot;High Tech,&quot; &quot;Classified Ads,&quot; and &quot;New Products.&quot;
